SET NAMES utf8;
SET time_zone = '+00:00';
SET foreign_key_checks = 0;
SET sql_mode = 'NO_AUTO_VALUE_ON_ZERO';

DROP TABLE IF EXISTS `accounts`;
CREATE TABLE `accounts` (
  `accountId` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL,
  `hash` varchar(8) COLLATE utf8_unicode_ci DEFAULT NULL,
  `registered` datetime DEFAULT NULL,
  PRIMARY KEY (`accountId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

DROP TABLE IF EXISTS `ads-settings`;
CREATE TABLE `ads-settings` (
  `ad728x90Status` int(11) DEFAULT NULL,
  `ad728x90ResponsiveStatus` int(11) DEFAULT NULL,
  `ad728x90` text COLLATE utf8_unicode_ci,
  `displayOnHomePage` int(11) DEFAULT NULL,
  `displayOnCoinPage` int(11) DEFAULT NULL,
  `displayOnDynamicPages` int(11) DEFAULT NULL,
  `displayOnContactPage` int(11) DEFAULT NULL,
  `displayOnWatchlistPage` int(11) DEFAULT NULL,
  `displayOnPortfolioPage` int(11) DEFAULT NULL,
  `displayOnMoversPage` int(11) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


DROP TABLE IF EXISTS `analytics-settings`;
CREATE TABLE `analytics-settings` (
  `status` int(11) DEFAULT NULL,
  `code` text COLLATE utf8_unicode_ci
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


DROP TABLE IF EXISTS `captcha-settings`;
CREATE TABLE `captcha-settings` (
  `siteKey` varchar(300) COLLATE utf8_unicode_ci DEFAULT NULL,
  `secretKey` varchar(300) COLLATE utf8_unicode_ci DEFAULT NULL,
  `loginCaptcha` int(11) DEFAULT NULL,
  `forgotPasswordCaptcha` int(11) DEFAULT NULL,
  `contactCaptcha` int(11) DEFAULT NULL,
  `resetPasswordCaptcha` int(11) DEFAULT NULL,
  `captchaShowFailedAttempts` int(11) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


DROP TABLE IF EXISTS `coins`;
CREATE TABLE `coins` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `cryptoId` int(11) DEFAULT NULL,
  `name` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `symbol` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `coinName` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `fullName` varchar(70) COLLATE utf8_unicode_ci DEFAULT NULL,
  `algorithm` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `proofType` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `fullyPremined` int(11) DEFAULT NULL,
  `totalCoinSupply` bigint(20) DEFAULT NULL,
  `preMinedValue` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `totalCoinsFreeFloat` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `sortOrder` int(11) DEFAULT NULL,
  `sponsored` int(11) DEFAULT NULL,
  `image` varchar(60) COLLATE utf8_unicode_ci DEFAULT NULL,
  `imageType` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `price` double DEFAULT NULL,
  `lastUpdate` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  `lastVolume` double DEFAULT NULL,
  `lastVolumeTo` double DEFAULT NULL,
  `lastTradeId` bigint(20) DEFAULT NULL,
  `volumeDay` double DEFAULT NULL,
  `volumeDayTo` double DEFAULT NULL,
  `volume24Hour` double DEFAULT NULL,
  `volume24HourTo` double DEFAULT NULL,
  `openDay` double DEFAULT NULL,
  `highDay` double DEFAULT NULL,
  `lowDay` double DEFAULT NULL,
  `open24Hour` double DEFAULT NULL,
  `high24Hour` double DEFAULT NULL,
  `low24Hour` double DEFAULT NULL,
  `lastMarket` varchar(60) COLLATE utf8_unicode_ci DEFAULT NULL,
  `change24Hour` double DEFAULT NULL,
  `changePercentage24Hour` double DEFAULT NULL,
  `changeDay` double DEFAULT NULL,
  `changePercentageDay` double DEFAULT NULL,
  `supply` double DEFAULT NULL,
  `marketCap` double DEFAULT NULL,
  `totalVolume24Hour` double DEFAULT NULL,
  `totalVolume24HourTo` double DEFAULT NULL,
  `affiliateLink` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL,
  `updateTimeStamp` varchar(200) COLLATE utf8_unicode_ci DEFAULT '0',
  `updateTimeStampCoins` varchar(200) COLLATE utf8_unicode_ci DEFAULT '0',
  `status` int(11) DEFAULT '1',
  `description` text COLLATE utf8_unicode_ci,
  `website` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `cryptoId_2` (`cryptoId`),
  UNIQUE KEY `symbol` (`symbol`),
  KEY `name` (`name`),
  KEY `coinName` (`coinName`),
  KEY `sortOrder` (`sortOrder`),
  KEY `price` (`price`),
  KEY `cryptoId` (`cryptoId`),
  KEY `fullName` (`fullName`),
  KEY `supply` (`supply`),
  KEY `marketCap` (`marketCap`),
  KEY `volume24Hour` (`volume24Hour`),
  KEY `changePercentage24Hour` (`changePercentage24Hour`),
  KEY `updateTimeStamp` (`updateTimeStamp`),
  KEY `volume24HourTo` (`volume24HourTo`),
  KEY `updateTimeStampCoins` (`updateTimeStampCoins`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


DROP TABLE IF EXISTS `currency-rates`;
CREATE TABLE `currency-rates` (
  `currency` varchar(5) COLLATE utf8_unicode_ci NOT NULL,
  `rate` double DEFAULT NULL,
  `countryCode` varchar(5) COLLATE utf8_unicode_ci DEFAULT NULL,
  `name` varchar(70) COLLATE utf8_unicode_ci DEFAULT NULL,
  `symbol` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`currency`),
  KEY `name` (`name`),
  KEY `symbol` (`symbol`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


DROP TABLE IF EXISTS `general-settings`;
CREATE TABLE `general-settings` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `title` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  `description` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL,
  `keywords` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL,
  `coverImage` varchar(60) COLLATE utf8_unicode_ci DEFAULT NULL,
  `lightLogo` varchar(60) COLLATE utf8_unicode_ci DEFAULT NULL,
  `darkLogo` varchar(60) COLLATE utf8_unicode_ci DEFAULT NULL,
  `favicon` varchar(60) COLLATE utf8_unicode_ci DEFAULT NULL,
  `affiliateLink` varchar(150) COLLATE utf8_unicode_ci DEFAULT NULL,
  `defaultCurrency` varchar(5) COLLATE utf8_unicode_ci DEFAULT NULL,
  `facebookAppId` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL,
  `openexchangeratesApiKey` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL,
  `sortByColumn` varchar(15) COLLATE utf8_unicode_ci DEFAULT NULL,
  `sortByType` varchar(4) COLLATE utf8_unicode_ci DEFAULT NULL,
  `https` int(11) DEFAULT NULL,
  `theme` varchar(10) COLLATE utf8_unicode_ci DEFAULT NULL,
  `www` int(11) DEFAULT NULL,
  `version` varchar(10) COLLATE utf8_unicode_ci DEFAULT NULL,
  `installed` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


DROP TABLE IF EXISTS `languages`;
CREATE TABLE `languages` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  `code` varchar(10) COLLATE utf8_unicode_ci DEFAULT NULL,
  `flag` varchar(10) COLLATE utf8_unicode_ci DEFAULT NULL,
  `status` int(11) DEFAULT '0',
  `displayOrder` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `status` (`status`),
  KEY `languageName` (`name`),
  KEY `languageCode` (`code`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


DROP TABLE IF EXISTS `mail-settings`;
CREATE TABLE `mail-settings` (
  `smtpStatus` int(11) DEFAULT NULL,
  `host` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  `port` int(11) DEFAULT NULL,
  `username` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  `password` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  `contactEmail` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


DROP TABLE IF EXISTS `pages`;
CREATE TABLE `pages` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `title` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  `permalink` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  `description` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL,
  `keywords` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL,
  `content` text COLLATE utf8_unicode_ci,
  `status` int(11) DEFAULT NULL,
  `displayOrder` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `permalink` (`permalink`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


DROP TABLE IF EXISTS `portfolio`;
CREATE TABLE `portfolio` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `accountId` int(11) DEFAULT NULL,
  `cryptoId` int(11) DEFAULT NULL,
  `on` datetime DEFAULT NULL,
  `qty` float DEFAULT NULL,
  `description` text COLLATE utf8_unicode_ci,
  PRIMARY KEY (`id`),
  KEY `accountId` (`accountId`),
  KEY `cryptoId` (`cryptoId`),
  CONSTRAINT `portfolio_ibfk_1` FOREIGN KEY (`accountId`) REFERENCES `accounts` (`accountId`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `portfolio_ibfk_3` FOREIGN KEY (`cryptoId`) REFERENCES `coins` (`cryptoId`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


DROP TABLE IF EXISTS `statistics`;
CREATE TABLE `statistics` (
  `date` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  `pageViews` bigint(20) DEFAULT '0',
  `uniqueViews` bigint(20) DEFAULT '0',
  KEY `date` (`date`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


DROP TABLE IF EXISTS `users`;
CREATE TABLE `users` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `username` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL,
  `email` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL,
  `password` varchar(32) COLLATE utf8_unicode_ci DEFAULT NULL,
  `role` varchar(32) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


DROP TABLE IF EXISTS `watchlist`;
CREATE TABLE `watchlist` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `accountId` int(11) DEFAULT NULL,
  `cryptoId` int(11) DEFAULT NULL,
  `on` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `accountId` (`accountId`),
  KEY `cryptoId` (`cryptoId`),
  CONSTRAINT `watchlist_ibfk_1` FOREIGN KEY (`accountId`) REFERENCES `accounts` (`accountId`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `watchlist_ibfk_3` FOREIGN KEY (`cryptoId`) REFERENCES `coins` (`cryptoId`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

